import Navbar from "../Navbar";
import Footer from "../Footer";
import globalStyles from "../../styles/global";

import { Container, Content } from "./styles";

const Layout = props => (
  <>
    <Container>
      <Navbar />
      <Content>{props.children}</Content>
      <Footer />
      {globalStyles}
    </Container>
  </>
);

export default Layout;
